definitions:
  Address:
    description: There is a variety of postal address formats defined around the world.
      This format defines a superset that is the basis for all addresses around the
      world. (default view)
    example:
      city: Consequatur omnis omnis tempore et.
      country: Suscipit ut quia sequi atque numquam.
      distinct: Quia fuga.
      line: Vero dicta voluptatibus consectetur ut minus.
      postalCode: 8.6064075e+18
      state: Neque quod similique est quia.
      type: postal
      use: work
    properties:
      city:
        description: The name of the city, town, village or other community or delivery
          center.
        example: Consequatur omnis omnis tempore et.
        type: string
      country:
        description: Country (can be ISO 3166 3 letter code)
        example: Suscipit ut quia sequi atque numquam.
        type: string
      distinct:
        description: District is sometimes known as county, but in some regions 'county'
          in used in place of city (municipality), so county name should be conveyed
          in city instead.
        example: Quia fuga.
        type: string
      line:
        description: This component contains the house number, apartment number, street
          name, street direction,  P.O. Box number, delivery hints, and similar address
          information.
        example: Vero dicta voluptatibus consectetur ut minus.
        type: string
      postalCode:
        description: A postal code designating a region defined by the postal service.
        example: 8.6064075e+18
        format: int64
        type: integer
      state:
        description: Sub-unit of a country with limited sovereignty in a federally
          organized country. A code may be used if codes are in common use (i.e. US
          2 letter state codes).
        example: Neque quod similique est quia.
        type: string
      type:
        description: Distinguishes between physical addresses (those you can visit)
          and mailing addresses (e.g. PO Boxes and care-of addresses). Most addresses
          are both.
        enum:
        - postal
        - physical
        - both
        example: postal
        type: string
      use:
        description: The use of an address
        enum:
        - home
        - work
        - temp
        - old - purpose of this address
        example: work
        type: string
    required:
    - use
    - type
    title: 'Mediatype identifier: application/vnd.address+json; view=default'
    type: object
